/*Table structure for table `orders` */

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `ORDER_ID` int(6) NOT NULL COMMENT 'PRIMARY KEY column.',
  `ORDER_DATE` varchar(20) NOT NULL DEFAULT 'CURRENT_TIMESTAMP' COMMENT 'TIMESTAMP WITH LOCAL TIME ZONE column, NOT NULL constraint.',
  `CUSTOMER_ID` int(6) NOT NULL,
  `ORDER_STATUS` varchar(2) DEFAULT NULL COMMENT '0: Not fully entered, 1: Entered, 2: Canceled - bad credit, -\n            3: Canceled - by customer, 4: Shipped - whole order, -\n            5: Shipped - replacement items, 6: Shipped - backlog on items, -\n            7: Shipped - special delivery, 8: Shipped - billed, 9: Shipped - payment plan,-\n            10: Shipped - paid',
  `ORDER_TOTAL` decimal(8,2) DEFAULT NULL COMMENT 'CHECK constraint.',
  PRIMARY KEY (`ORDER_ID`),
  KEY `FK_Reference_4` (`CUSTOMER_ID`),
  CONSTRAINT `FK_Reference_4` FOREIGN KEY (`CUSTOMER_ID`) REFERENCES `customers` (`CUST_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

