/*Table structure for table `products` */

DROP TABLE IF EXISTS `products`;

CREATE TABLE `products` (
  `PRODUCT_ID` int(6) NOT NULL COMMENT 'Primary key column.',
  `PRODUCT_NAME` varchar(50) DEFAULT NULL,
  `PRODUCT_DESCRIPTION` varchar(2000) DEFAULT NULL COMMENT 'Primary language description corresponding to translated_description in\n            oe.product_descriptions, added to provide non-NLS text columns for OC views\n            to accss.',
  `CATEGORY_ID` int(2) DEFAULT NULL COMMENT 'Low cardinality column, can be used for bitmap index.\n            Schema SH uses it as foreign key',
  `WARRANTY_PERIOD` int(3) DEFAULT NULL COMMENT 'INTERVAL YEAER TO MONTH column, low cardinality, can be used for bitmap\n            index.',
  `ORIGINAL_PRICE` decimal(8,2) DEFAULT NULL,
  `PRESENT_PRICE` decimal(8,2) DEFAULT NULL,
  `QUANTITY` int(8) DEFAULT NULL,
  `PIC_BIG` varchar(100) DEFAULT NULL,
  `PIC_SMALL` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`PRODUCT_ID`),
  KEY `FK_Reference_1` (`CATEGORY_ID`),
  CONSTRAINT `FK_Reference_1` FOREIGN KEY (`CATEGORY_ID`) REFERENCES `categories` (`CATEGORY_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

