ciationShop/images/modem/modem_small.png'),(3086,'VRAM - 16 MB','Citrus Video RAM module - 16 MB capacity. VRAM is used by the video system in a computer to store video information and is reserved exclusively for video operations. It was developed to provide continuous streams of serial data for refreshing video screens.',14,2,'211.00','186.00',100,'/AssociationShop/images/memory/memory_vram_big.png','/AssociationShop/images/memory/memory_vram_small.png'),(3087,'DIMM - 16 MB','Citrus OLX DIMM - 16 MB capacity.',14,2,'124.00','99.00',100,'/AssociationShop/images/memory/memory_dimm_big.png','/AssociationShop/images/memory/memory_dimm_small.png'),(3088,'SDRAM - 32 MB','SDRAM module with ECC - 32 MB capacity. SDRAM has multiple memory banks that can work simultaneously. Switching between banks allows for a continuous data flow.',14,2,'258.00','220.00',100,'/AssociationShop/images/memory/memory_sdram_big.png','/AssociationShop/images/memory/memory_sdram_small.png'),(3090,'RAM - 48 MB','Random Access Memory, SIMM - 48 MB capacity.',14,2,'193.00','170.00',100,'/AssociationShop/images/memory/memory_ram_big.png','/AssociationShop/images/memory/memory_ram_small.png'),(3091,'VRAM - 64 MB','Citrus Video RAM memory module - 64 MB capacity. Physically, VRAM looks just like DRAM with added hardware called a shift register. The special feature of VRAM is that it can transfer one entire row of data (up to 256 bits) into this shift register in a single clock cycle. This ability significantly reduces retrieval time, since the number of fetches is reduced from a possible 256 to a single fetch. The main benefit of having a shift register available for data dumps is that it frees the CPU to refresh the screen rather than retrieve data, thereby doubling the data bandwidth. For this reason, VRAM is often referred to as being dual-ported. However, the shift register will only be used when the VRAM chip is given special instructions to do so. The command to use the shift register is built in